import React from 'react';
import './Home.css'; // CSS dosyası için
import 'bootstrap/dist/css/bootstrap.min.css';

const Home = () => {
    return (
        <div className="container mt-4">
            <div className="row">
                {/* Reklam 2 grid */}
                <div className="col-md-2">
                    <div className="ad-section">Reklam Alanı 1</div>
                </div>
                <div className="col-md-2">
                    <div className="ad-section">Reklam Alanı 2</div>
                </div>

                {/* Para birimleri 8 grid */}
                <div className="col-md-8">
                    <div className="currency-section">
                        <h3>Para Birimleri</h3>
                        {/* Para birimlerinin ve grafiklerinin yer alacağı yer */}
                        <div className="tradingview-widget">
                            {/* TradingView widget kodu buraya yerleştirilecek */}
                            <iframe src="YOUR_TRADINGVIEW_WIDGET_URL" width="100%" height="400" title="TradingView Widget"></iframe>
                        </div>
                    </div>
                </div>

                {/* Login/Register 2 grid */}
                <div className="col-md-2">
                    <div className="auth-section">
                        <h3>Login/Register</h3>
                        {/* Login ve Register bileşenini burada kullanabilirsiniz */}
                    </div>
                </div>

                {/* Son 2 grid reklam */}
                <div className="col-md-2">
                    <div className="ad-section">Reklam Alanı 3</div>
                </div>
                <div className="col-md-2">
                    <div className="ad-section">Reklam Alanı 4</div>
                </div>
            </div>
        </div>
    );
};

export default Home;
